// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.8.4;

import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Factory.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";

import "../libraries/TransferHelper.sol";
import "../interfaces/IERC20.sol";
import "../interfaces/IDEXIntegration.sol";
import "../interfaces/IUniswapV3StaticQuoter.sol";
import "../base/Lockable.sol";

contract PancakeswapV3DEXIntegration is IDEXIntegration, Lockable {
    address public immutable factory;
    address public immutable quoter; // https://github.com/ultimexfi/uniswap-v3-static-quoter
    address public immutable router;
    uint24[] public feeTiers;

    constructor(address _factory, address _quoter, address _router) {
        factory = _factory;
        quoter = _quoter;
        router = _router;
        feeTiers.push(100);
        feeTiers.push(500);
        feeTiers.push(2500);
        feeTiers.push(10000);
    }

    function _sortTokens(
        address _tokenA,
        address _tokenB
    ) internal pure returns (address token0, address token1) {
        if (
            _tokenA != _tokenB && _tokenA != address(0) && _tokenB != address(0)
        ) {
            (token0, token1) = _tokenA < _tokenB
                ? (_tokenA, _tokenB)
                : (_tokenB, _tokenA);
        }
    }

    function validatePair(
        address _tokenIn,
        address _tokenOut
    ) external view override returns (bool) {
        if (_tokenIn == _tokenOut) {
            return false;
        }
        uint24[] memory _feeTiers = feeTiers;
        address _factory = factory;
        for (uint8 i = 0; i < _feeTiers.length; i++) {
            address pool = IUniswapV3Factory(_factory).getPool(
                _tokenIn,
                _tokenOut,
                _feeTiers[i]
            );
            if (pool != address(0)) {
                return true;
            }
        }
        return false;
    }

    function _getAmountOut(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountIn
    ) internal view returns (uint256 amountOut, uint24 fee) {
        uint24[] memory _feeTiers = feeTiers;
        address _quoter = quoter;
        for (uint8 i = 0; i < _feeTiers.length; i++) {
            uint256 tempAmountOut;
            try
                IUniswapV3StaticQuoter(_quoter).quoteExactInputSingle(
                    IUniswapV3StaticQuoter.QuoteExactInputSingleParams({
                        tokenIn: _tokenIn,
                        tokenOut: _tokenOut,
                        amountIn: _amountIn,
                        fee: _feeTiers[i],
                        sqrtPriceLimitX96: 0
                    })
                )
            returns (uint256 t) {
                tempAmountOut = t;
            } catch (bytes memory /*lowLevelData*/) {
                tempAmountOut = 0;
            }
            if (tempAmountOut > amountOut) {
                amountOut = tempAmountOut;
                fee = _feeTiers[i];
            }
        }
    }

    function _getAmountIn(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountOut
    ) internal view returns (uint256 amountIn, uint24 fee) {
        uint24[] memory _feeTiers = feeTiers;
        address _quoter = quoter;
        for (uint8 i = 0; i < _feeTiers.length; i++) {
            uint256 tempAmountIn;
            try
                IUniswapV3StaticQuoter(_quoter).quoteExactOutputSingle(
                    IUniswapV3StaticQuoter.QuoteExactOutputSingleParams({
                        tokenIn: _tokenIn,
                        tokenOut: _tokenOut,
                        amount: _amountOut,
                        fee: _feeTiers[i],
                        sqrtPriceLimitX96: 0
                    })
                )
            returns (uint256 t) {
                tempAmountIn = t;
            } catch (bytes memory /*lowLevelData*/) {
                tempAmountIn = 0;
            }
            if (
                amountIn == 0 || (tempAmountIn > 0 && tempAmountIn < amountIn)
            ) {
                amountIn = tempAmountIn;
                fee = _feeTiers[i];
            }
        }
    }

    function getAmountOut(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountIn
    ) external view override returns (uint256 amountOut) {
        (amountOut, ) = _getAmountOut(_tokenIn, _tokenOut, _amountIn);
    }

    function getAmountIn(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountOut
    ) external view override returns (uint256 amountIn) {
        (amountIn, ) = _getAmountIn(_tokenIn, _tokenOut, _amountOut);
    }

    function swap(
        address _tokenIn,
        address _tokenOut,
        address _to
    ) external override lock returns (uint256 amountOut) {
        uint256 amountIn = IERC20(_tokenIn).balanceOf(address(this));
        uint24 fee;
        (amountOut, fee) = _getAmountOut(_tokenIn, _tokenOut, amountIn);
        require(
            amountOut > 0 && fee > 0,
            "UniswapV3Integration: INSUFFICIENT_OUTPUT_AMOUNT"
        );

        address _router = router;
        if (IERC20(_tokenIn).allowance(address(this), _router) == 0) {
            TransferHelper.safeApprove(_tokenIn, _router, type(uint256).max);
        }

        uint256 initialBalance = IERC20(_tokenOut).balanceOf(_to);
        ISwapRouter(_router).exactInputSingle(
            ISwapRouter.ExactInputSingleParams({
                tokenIn: _tokenIn,
                tokenOut: _tokenOut,
                fee: fee,
                recipient: _to,
                deadline: block.timestamp,
                amountIn: amountIn,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            })
        );

        uint256 balance = IERC20(_tokenOut).balanceOf(_to);
        amountOut = balance - initialBalance;
    }
}

contracts/integrations/PancakeswapV3Pric.content:
// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.8.4;

import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Factory.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import "../interfaces/IPriceFeedIntegration.sol";
import "../interfaces/IERC20.sol";

contract PancakeswapV3PriceFeedIntegration is IPriceFeedIntegration {
    uint256 public constant override PRECISION = 1e30;
    address public immutable factory;
    uint24[] public feeTiers = [100, 500, 2500, 10000];

    constructor(address _factory) {
        factory = _factory;
    }

    function mulDiv(
        uint256 a,
        uint256 b,
        uint256 denominator
    ) internal pure returns (uint256 result) {
        // 512-bit multiply [prod1 prod0] = a * b
        // Compute the product mod 2**256 and mod 2**256 - 1
        // then use the Chinese Remainder Theorem to reconstruct
        // the 512 bit result. The result is stored in two 256
        // variables such that product = prod1 * 2**256 + prod0
        uint256 prod0; // Least significant 256 bits of the product
        uint256 prod1; // Most significant 256 bits of the product
        assembly {
            let mm := mulmod(a, b, not(0))
            prod0 := mul(a, b)
            prod1 := sub(sub(mm, prod0), lt(mm, prod0))
        }

        // Handle non-overflow cases, 256 by 256 division
        if (prod1 == 0) {
            require(denominator > 0);
            assembly {
                result := div(prod0, denominator)
            }
            return result;
        }

        // Make sure the result is less than 2**256.
        // Also prevents denominator == 0
        require(denominator > prod1);

        ///////////////////////////////////////////////
        // 512 by 256 division.
        ///////////////////////////////////////////////

        // Make division exact by subtracting the remainder from [prod1 prod0]
        // Compute remainder using mulmod
        uint256 remainder;
        assembly {
            remainder := mulmod(a, b, denominator)
        }
        // Subtract 256 bit number from 512 bit number
        assembly {
            prod1 := sub(prod1, gt(remainder, prod0))
            prod0 := sub(prod0, remainder)
        }

        // Factor powers of two out of denominator
        // Compute largest power of two divisor of denominator.
        // Always >= 1.
        uint256 twos = denominator & (~denominator + 1);
        // Divide denominator by power of two
        assembly {
            denominator := div(denominator, twos)
        }

        // Divide [prod1 prod0] by the factors of two
        assembly {
            prod0 := div(prod0, twos)
        }
        // Shift in bits from prod1 into prod0. For this we need
        // to flip `twos` such that it is 2**256 / twos.
        // If twos is zero, then it becomes one
        assembly {
            twos := add(div(sub(0, twos), twos), 1)
        }
        prod0 |= prod1 * twos;

        // Invert denominator mod 2**256
        // Now that denominator is an odd number, it has an inverse
        // modulo 2**256 such that denominator * inv = 1 mod 2**256.
        // Compute the inverse by starting with a seed that is correct
        // correct for four bits. That is, denominator * inv = 1 mod 2**4
        uint256 inv = (3 * denominator) ^ 2;
        // Now use Newton-Raphson iteration to improve the precision.
        // Thanks to Hensel's lifting lemma, this also works in modular
        // arithmetic, doubling the correct bits in each step.
        inv *= 2 - denominator * inv; // inverse mod 2**8
        inv *= 2 - denominator * inv; // inverse mod 2**16
        inv *= 2 - denominator * inv; // inverse mod 2**32
        inv *= 2 - denominator * inv; // inverse mod 2**64
        inv *= 2 - denominator * inv; // inverse mod 2**128
        inv *= 2 - denominator * inv; // inverse mod 2**256

        // Because the division is now exact we can divide by multiplying
        // with the modular inverse of denominator. This will give us the
        // correct result modulo 2**256. Since the precoditions guarantee
        // that the outcome is less than 2**256, this is the final result.
        // We don't need to compute the high bits of the result and prod1
        // is no longer required.
        result = prod0 * inv;
        return result;
    }

    function getPrice(
        address _baseToken,
        address _quoteToken
    ) external view override returns (uint256 price) {
        if (_baseToken == _quoteToken) {
            return PRECISION;
        }

        uint256 length = feeTiers.length;
        IUniswapV3Factory _factory = IUniswapV3Factory(factory);
        uint256 bestLiquidity;
        (address token0, address token1) = _baseToken < _quoteToken
            ? (_baseToken, _quoteToken)
            : (_quoteToken, _baseToken);
        for (uint256 i = 0; i < length; i++) {
            address poolAddress = _factory.getPool(token0, token1, feeTiers[i]);
            if (poolAddress != address(0)) {
                IUniswapV3Pool pool = IUniswapV3Pool(poolAddress);
                uint256 balance0 = IERC20(token0).balanceOf(poolAddress);
                uint256 balance1 = IERC20(token1).balanceOf(poolAddress);
                (uint160 sqrtPriceX96, , , , , , ) = pool.slot0();
                uint256 price0 = mulDiv(
                    uint256(sqrtPriceX96) ** 2,
                    PRECISION,
                    1 << 192
                );
                uint256 liquidity = (balance0 * price0) / PRECISION + balance1;
                if (liquidity > bestLiquidity) {
                    bestLiquidity = liquidity;
                    price = price0;
                }
            }
        }

        if (price != 0 && _baseToken != token0) {
            price = PRECISION ** 2 / price;
        }

        uint256 baseDecimals = IERC20(_baseToken).decimals();
        uint256 quoteDecimals = IERC20(_quoteToken).decimals();
        uint256 basePrec = 10 ** baseDecimals;
        uint256 quotePrec = 10 ** quoteDecimals;
        price = (price * basePrec) / quotePrec;
    }
}

